sources.styles/sass/base/_typography.scss:
@import "../abstracts/variables";

html {
  font-size: 62.5%;
}

body {
  font-family: Arial, Helvetica, sans-serif;
  line-height: 2;
  font-size: 1.6rem;
  color: $text-color;
}

h1,
h2,
h3 {
  line-height: 1.1;
}

h1 {
  font-size: 5.2rem;
  font-weight: 100;
}

h2 {
  font-size: 2.6rem;
  font-weight: bold;
}

h3 {
  font-size: 1.8rem;
}

a {
  text-decoration: none;
}

@media screen and (min-width: 1024px) {
  body {
    font-size: 1.4rem;
  }
  h1 {
    font-size: 4.8rem;
  }
  h2 {
    font-size: 2.4rem;
  }
  h3 {
    font-size: 1.4rem;
  }
}

