.grid-container {
  display: grid;
  grid-template-columns: 20% 40fr 40fr;
  grid-template-rows: 70px 400px 400px 400px 500px;
  .code-example__title {
    color: white;
  }
  .side-col {
    grid-column-start: 1;
    grid-row-start: 1;
    grid-row-end: 6;
  }
  .menu-result-table-col {
    grid-column-start: 2;
    grid-row-start: 3;
    grid-row-end: 4;
    grid-column-end: 3;
  }
  .parameter-table-col {
    grid-column-start: 2;
    grid-row-start: 3;
    grid-row-end: 5;
  }
  .result-table-col {
    grid-column-start: 2;
    grid-row-start: 5;
    grid-row-end: 6;
  }
  .menu-result-intro-col {
    grid-column-start: 2;
    grid-row-start: 1;
  }
  .links-col {
    grid-column: 3/4;
  }
  .initialize-col {
    grid-column: 3/4;
  }
  .stored-widget-col {
    grid-column: 3/4;
  }
  .results-col {
    grid-column: 3/4;
  }
}

@media screen and (max-width: 1200px) {
  .grid-container {
    grid-template-columns: auto;
    grid-template-rows: auto;
    .code-showcase-col {
      grid-row: 1;
      grid-column: 1;
    }
    .menu-result-intro-col {
      grid-row: 2;
      grid-column: 1;
    }
    .initialize-col {
      grid-column: 1;
      grid-row: 3;
    }
    .parameter-table-col {
      grid-column: 1;
      grid-row: 4;
    }
    .stored-widget-col {
      grid-column: 1;
      grid-row: 5;
    }
    .result-table-col {
      grid-column: 1;
      grid-row: 6;
    }

    .links-col {
      grid-column: 1;
    }

    .stored-widget-col {
      grid-column: 1;
    }
    .results-col {
      grid-column: 1;
    }
    .side-col {
      grid-row: 1;
      grid-column: 1;
    }
    .menu-result-table-col {
      grid-column: 1;
    }
    .code-example__title {
      display: none;
    }
    .side-col {
      display: none;
    }
  }
}

